import React from "react";
import {
  BoxContainer,
  ImageContainer,
  ContentContainer,
  Title,
  Description
} from "../Styles";

const ProductBox = ({ imageUrl, description }) => {
  return (
    <BoxContainer>
      <ImageContainer>
        <img src={imageUrl} alt="Tecido do produto" />
      </ImageContainer>
      <ContentContainer>
        <Title>TECIDO</Title>
        <Description>{description}</Description>
      </ContentContainer>
    </BoxContainer>
  );
};

export default ProductBox;
